import React from "react";
import "../App.css";
import { Tabs, TabList, Tab, textDecoration} from '@chakra-ui/react'
import { extendTheme } from "@chakra-ui/react";

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  components: {
    Tabs: {
      baseStyle: {
        tab: {
          _hover: {
            content: '',
            width: "0px",
            height: "1px",
            background: "black",
            transition: "300ms"
          },
        },
      },
    },
  },
});

function HeaderBar() {
    return (
      <Tabs position='relative' variant='unstyled' theme={theme}>
        <TabList>
          <Tab > One</Tab>
          <Tab >Two</Tab>
          <Tab > Three</Tab>
        </TabList>
      </Tabs>
    );
    }

export default HeaderBar;
